Dutch:
Beatrice moet op zoek naar antwoorden en bondgenoten in de ruines van het futuristische Chicago. Samen met Four zijn ze nu vluchtelingen, opgejaagd door Jeanine, de leider van de op macht beluste groepering Erudite. In een race tegen de klok moeten ze er achter zien te komen waarvoor de familie van Beatrice zich heeft opgeofferd en waarom de leiders van Erudite er alles aan doen om hen te stoppen.
